import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import { Mousewheel, Pagination } from 'swiper/modules';

const Time: React.FC = () => {
    const TIME_HOURS = Array.from(Array(24).keys());
    const TIME_MINUTES = Array(12)
        .fill(0)
        .map((num, i) => i * 5);
    return (
        <div className='w-full flex justify-center items-center h-screen'>
            <div className='border w-[200px] shadow-xl rounded-xl'>
                <div className='text-[12px] flex items-center justify-center pt-2'>
                    도착시간
                </div>
                <Swiper
                    direction={'vertical'}
                    slidesPerView={3}
                    mousewheel
                    modules={[Mousewheel]}
                    loopAdditionalSlides={5}
                    slideToClickedSlide
                    centeredSlides
                    className="h-[160px] px-[1.1rem]"
                >
                    {TIME_HOURS.map((hour) => (
                        <SwiperSlide key={hour}>
                            <div
                                className="flex h-[20px] cursor-pointer items-center justify-center"
                            >
                                {(hour + "").padStart(2, "0")}
                            </div>
                        </SwiperSlide>
                    ))}
                </Swiper>
                <div className='w-full flex text-[12px] font-semibold'>
                    <div className='basis-1/2 border-black/40 border text-center mx-2 my-2 rounded-lg py-1.5'>
                        <button>
                            취소
                        </button>
                    </div>
                    <div className='basis-1/2 border border-black/40 text-center mx-2 my-2 rounded-lg py-1.5 base-bg'>
                        <button>
                            저장
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Time;
